import FlightDetailsModel from "../model/flightDetails.model";
import path from "path";
import fs, { existsSync } from "fs";
import multer, { diskStorage } from "multer";
import { error } from "console";

const storage = multer.diskStorage({
  destination: function (req, file, cb) {
    const uploadPath = "./uploads";
    const subFolder = "flightlogo";

    if (!fs.existsSync(uploadPath)) {
      fs.mkdirSync(uploadPath);
    }

    const subFolderPath = path.join(uploadPath, subFolder);
    if (!fs.existsSync(subFolderPath)) {
      fs.mkdirSync(subFolderPath);
    }

    cb(null, subFolderPath);
  },
  filename: function (req, file, cb) {
    const name = file.originalname;

    const ext = path.extname(name);

    const nameArr = name.split(".");
    nameArr.pop();

    const fname = nameArr.join(".");

    const fullname = fname + "-" + Date.now() + ext;
    cb(null, fullname);
  },
});

const upload = multer({ storage: storage });

export const getAllFlights = async (req, res) => {
  try {
    const flightData = await FlightDetailsModel.find();

    if (flightData) {
      return res.status(200).json({
        data: flightData,
        message: "success",
      });
    }
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

export const getSingleFlight = async (req, res) => {
  try {
    const flightID = req.params.flightID;

    const flightData = await FlightDetailsModel.findOne({ _id: flightID });

    if (flightData) {
      return res.status(200).json({
        data: flightData,
        message: "success",
      });
    }
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

export const addFlight = (req, res) => {
  try {
    const uploadData = upload.single("flightLogo");
    uploadData(req, res, function (error) {
      if (error) return res.status(400).json({ message: error.message });

      const { flightName, flightNumber } = req.body;

      let flightLogo = null;

      if (req.file !== undefined) {
        flightLogo = req.file.filename;
      }

      const createdRecord = new FlightDetailsModel({
        flightName: flightName,
        flightNumber: flightNumber,
        flightLogo: flightLogo,
      });

      createdRecord.save();
      if (createdRecord) {
        return res.status(201).json({
          data: createdRecord,
          message: "success",
        });
      }
    });
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

export const deleteFlight = async (req, res) => {
  try {
    const flightID = req.params.flightID;

    const logo = await FlightDetailsModel.findOne({ _id: flightID });

    if (fs.existsSync("./uploads/flightlogo/" + logo.flightLogo)) {
      fs.unlinkSync("./uploads/flightlogo/" + logo.flightLogo);
    }

    const removeFlight = await FlightDetailsModel.deleteOne({ _id: flightID });

    if (removeFlight) {
      return res.status(200).json({
        message: "deleted",
      });
    }
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

export const updateFlight = async (req, res) => {
  try {
    const uploadData = upload.single("flightLogo");

    uploadData(req, res, async function (error) {
      if (error) return res.status(400).json({ message: error.message });

      const flightID = req.params.flightID;

      const { flightName, flightNumber } = req.body;

      const flightData = await FlightDetailsModel.findOne({ _id: flightID });

      let logo = flightData.flightLogo;
      console.log(logo);

      if (req.file !== undefined) {
        logo = req.file.filename;
        if (fs.existsSync("./uploads/flightlogo/" + flightData.flightLogo)) {
          fs.unlinkSync("./uploads/flightlogo/" + flightData.flightLogo);
        }
      }

      const updatedRecord = await FlightDetailsModel.updateOne(
        {
          _id: flightID,
