            flightName: flightName,
            flightNumber: flightNumber,
            flightLogo: logo,
          },
        }
      );

      if (updatedRecord.acknowledged) {
        return res.status(200).json({
          data: updatedRecord,
          message: "updated",
        });
      }
    });
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

