import TraverlClassModel from "../model/traverlClass.model";

export const getAllTravelClass = async (req, res) => {
  try {
    const flightData = await TraverlClassModel.find();
    if (flightData) {
      return res.status(200).json({
        data: flightData,
        message: "success",
      });
    }
  } catch (error) {
    return res.status(500).json({
      message: error.message,
    });
  }
};

export const getTravelClass = async (req, res) => {
  try {
    const travelClassID = req.params.travelClassID;

    const travelClassData = await TraverlClassModel.findOne({
      _id: travelClassID,
    });
    if (travelClassData) {
      return res.status(200).json({
        data: travelClassData,
        message: "success",
      });
    }
  } catch (err) {
    return res.status(500).json({
      message: err.message,
    });
  }
};

export const addTravelClass = (req, res) => {
  try {
    const { economy, premiumEconomy, business, firstClass } = req.body;

    const createdRecord = new TraverlClassModel({
      economy: economy,
      premiumEconomy: premiumEconomy,
      business: business,
      firstClass: firstClass,
    });
    createdRecord.save();

    if (createdRecord) {
      return res.status(201).json({
        data: createdRecord,
        message: "Success",
      });
    }
  } catch (err) {
    return res.status(500).json({
      message: err.message,
    });
  }
};

export const updateTravelClass = async (req, res) => {
  try {
    const travelClassID = req.params.travelClassID;
    const { economy, premiumEconomy, business, firstClass } = req.body;

    const travelClassData = await TraverlClassModel.updateOne(
      { _id: travelClassID },
      {
        $set: {
          economy: economy,
          premiumEconomy: premiumEconomy,
          business: business,
          firstClass: firstClass,
        },
      }
    );
    if (travelClassData.acknowledged) {
      return res.status(200).json({
        data: travelClassData,
        message: "updated",
      });
    }
  } catch (err) {
    return res.status(500).json({
      message: err.message,
    });
  }
};

export const deleteTravelCLass = async (req, res) => {
  try {
    const travelClassID = req.params.travelClassID;

    const travelClassData = await TraverlClassModel.deleteOne({
      _id: travelClassID,
    });

    if (travelClassData) {
      return res.status(200).json({
        message: "deleted",
      });
    }
  } catch (err) {
    return res.status(500).json({
      message: err.message,
    });
  }
};

