import mongoose from "mongoose";
const Schema = mongoose.Schema;

const travelSchema = new Schema({
  economy: {
    type: String,
    required: true,
  },
  premiumEconomy: {
    type: String,
    required: true,
  },
  business: {
    type: String,
    required: true,
  },
  firstClass: {
    type: String,
    required: true,
  },
});

export default mongoose.model("TravelClass", travelSchema);

