import {
  getAllTravelClass,
  getTravelClass,
  addTravelClass,
  updateTravelClass,
  deleteTravelCLass,
} from "../Controller/travelClass.controller";
import express from "express";

const router = express.Router();

router.get("/get-all-travelClass", getAllTravelClass);
router.get("/get-travelClass/:travelClassID", getTravelClass);
router.post("/add-travelClass", addTravelClass);
router.put("/update-travelClass/:travelClassID", updateTravelClass);
router.delete("/delete-travelClass/:travelClassID", deleteTravelCLass);

export default router;

